// src/components/DocumentPanel.jsx
// src/components/DocumentPanel.jsx
import { useEffect, useState } from 'react';
import {
  Box, Typography, List, ListItem, ListItemText, Button, TextField, MenuItem
} from '@mui/material';

// ✅ keep ONLY this import from ../api
import { listDocuments, uploadViaProxy, getDocumentUrl, deleteDocument } from '../api';



const KINDS = [
  { id: 'title_search', label: 'Title search document' },
  { id: 'pool_safety',  label: 'Pool safety certificate' },
  { id: 'smoke_alarm',  label: 'Smoke alarm compliance' },
  { id: 'bcorp_info',   label: 'Body corporate information' },
];

export default function DocumentPanel({ propertyId, onChanged, initialKind }) {
  const [docs, setDocs] = useState([]);
  const [kind, setKind] = useState(initialKind || 'title_search');
  const [file, setFile] = useState(null);
  const [busy, setBusy] = useState(false);

  useEffect(() => { if (initialKind) setKind(initialKind); }, [initialKind]);

  async function refresh() {
    const list = await listDocuments(propertyId);
    setDocs(list);
  }
  useEffect(() => { refresh(); }, [propertyId]);

  const upload = async () => {
    if (!file) return;
    setBusy(true);
    try {
      // (optional) lightweight client-side checks
      if (file.size > 20 * 1024 * 1024) {
        alert('Max size 20MB');
        setBusy(false);
        return;
      }
      const okExt = ['pdf', 'jpg', 'jpeg', 'png'].some(ext =>
        file.name.toLowerCase().endsWith(`.${ext}`)
      );
      if (!okExt) {
        alert('Only PDF/JPG/PNG allowed');
        setBusy(false);
        return;
      }

      // ➜ Proxy upload via backend (no CORS needed)
      await uploadViaProxy(propertyId, { file, kind });

      setFile(null);
      await refresh();
      onChanged?.(); // tell parent to recompute progress
    } catch (e) {
      console.error(e);
      alert(e.message || 'Upload failed');
    } finally {
      setBusy(false);
    }
  };

  const download = async (docId) => {
    try {
      const { url } = await getDocumentUrl(propertyId, docId);
      window.open(url, '_blank', 'noopener,noreferrer');
    } catch (e) {
      console.error(e);
      alert('Download failed');
    }
  };

  const remove = async (docId) => {
    if (!window.confirm('Delete this document?')) return;
    try {
      await deleteDocument(propertyId, docId);
      await refresh();
      onChanged?.();
    } catch (e) {
      console.error(e);
      alert('Delete failed');
    }
  };

  return (
    <Box mt={3}>
      <Typography variant="h6" gutterBottom>Documents</Typography>

      <Box display="flex" gap={2} alignItems="center" mb={2}>
        <TextField
          select
          label="Kind"
          size="small"
          value={kind}
          onChange={(e) => setKind(e.target.value)}
          sx={{ minWidth: 280 }}
        >
          {KINDS.map(k => <MenuItem key={k.id} value={k.id}>{k.label}</MenuItem>)}
        </TextField>

        <input type="file" onChange={(e) => setFile(e.target.files?.[0] ?? null)} />
        <Button disabled={!file || busy} variant="contained" onClick={upload}>
          {busy ? 'Uploading…' : 'Upload'}
        </Button>
      </Box>

      <List>
        {docs.map(d => (
          <ListItem
            key={d.id}
            divider
            secondaryAction={
              <Box sx={{ display: 'flex', gap: 1 }}>
                <Button size="small" onClick={() => download(d.id)}>Open</Button>
                <Button size="small" color="error" onClick={() => remove(d.id)}>Delete</Button>
              </Box>
            }
          >
            <ListItemText
              primary={`${d.kind} — ${d.filename}`}
              secondary={`Uploaded ${new Date(d.createdAt).toLocaleString()}`}
            />
          </ListItem>
        ))}
        {docs.length === 0 && (
          <ListItem><ListItemText primary="No documents yet." /></ListItem>
        )}
      </List>
    </Box>
  );
}
